import "./App.css";

const customStyle = {
  width: "200px",
  height: "200px",
};

function App() {
  return (
    <div>
      <h1>My Favourite Cities</h1>
      <ul>
        <li>Bengaluru</li>
        <li>Mumbai</li>
        <li>Delhi</li>
      </ul>
      <img
        src="https://static.toiimg.com/thumb/msid-54559212,width-748,height-499,resizemode=4,imgsize-307081/.jpg"
        alt="Vidhana Soudha"
        style={customStyle}
      />
    </div>
  );
}

export default App;
